function goToExercise(hypeDocument, element, event) {
	var prefix = "srexercise://";
	var instrument = "15Trumpet--";            //CHANGE ME CHANGE ME CHANGE ME
	var category = "11Lessons Level 1--";       //CHANGE ME CHANGE ME CHANGE ME
	var index = "99";
	var exercise = element.innerHTML;
	var suffix = ".xml";

	window.location.href = encodeURI(prefix+instrument+category+index+exercise+suffix);
	//console.log(encodeURI(prefix+instrument+category+index+exercise+suffix));



}
